The license of the package. This can be either a string or an array of strings. The recommended notation for the most common licenses is (alphabetical): Apache-2.0 BSD-2-Clause BSD-3-Clause BSD-4-Clause GPL-2.0-only / GPL-2.0-or-later GPL-3.0-only / GPL-3.0-or-later LGPL-2.1-only / LGPL-2.1-or-later LGPL-3.0-only / LGPL-3.0-or-later MIT Optional, but it is highly recommended to supply this. More identifiers are listed at the SPDX Open Source License Registry . Note: For closed-source software, you may use "proprietary" as the license identifier. An Example: { "license": "MIT"
} For a package, when there is a choice between licenses ("disjunctive license"), multiple can be specified as an array. An Example for disjunctive licenses: { "license": [ "LGPL-2.1-only", "GPL-3.0-or-later" ]
} Alternatively they can be separated with "or" and enclosed in parentheses; { "license": "(LGPL-2.1-only or GPL-3.0-or-later)"
} Similarly, when multiple licenses need to be applied ("conjunctive license"), they should be separated with "and" and enclosed in parentheses.

