Autoload mapping for a PHP autoloader. PSR-4 and PSR-0 autoloading, classmap generation and files includes are supported. PSR-4 is the recommended way since it offers greater ease of use (no need to regenerate the autoloader when you add classes). PSR-4 Under the psr-4 key you define a mapping from namespaces to paths, relative to the package root. When autoloading a class like Foo\\Bar\\Baz a namespace prefix Foo\\ pointing to a directory src/ means that the autoloader will look for a file named src/Bar/Baz.php and include it if present. Note that as opposed to the older PSR-0 style, the prefix (Foo\\) is not present in the file path. Namespace prefixes must end in \\ to avoid conflicts between similar prefixes. For example Foo would match classes in the FooBar namespace so the trailing backslashes solve the problem: Foo\\ and FooBar\\ are distinct. The PSR-4 references are all combined, during install/update, into a single key => value array which may be found in the generated file vendor/composer/autoload_psr4.php. Example: { "autoload": { "psr-4": { "Monolog\\": "src/", "Vendor\\Namespace\\": "" } }
} If you need to search for a same prefix in multiple directories, you can specify them as an array as such: { "autoload": { "psr-4": { "Monolog\\": ["src/", "lib/"] } }
} If you want to have a fallback directory where any namespace will be looked for, you can use an empty prefix like: { "autoload": { "psr-4": { "": "src/" } }
} PSR-0 Under the psr-0 key you define a mapping from namespaces to paths, relative to the package root. Note that this also supports the PEAR-style non-namespaced convention. Please note namespace declarations should end in \\ to make sure the autoloader responds exactly. For example Foo would match in FooBar so the trailing backslashes solve the problem: Foo\\ and FooBar\\ are distinct. The PSR-0 references are all combined, during install/update, into a single key => value array which may be found in the generated file vendor/composer/autoload_namespaces.php. Example: { "autoload": { "psr-0": { "Monolog\\": "src/", "Vendor\\Namespace\\": "src/", "Vendor_Namespace_": "src/" } }
} If you need to search for a same prefix in multiple directories, you can specify them as an array as such: { "autoload": { "psr-0": { "Monolog\\": ["src/", "lib/"] } }
} The PSR-0 style is not limited to namespace declarations only but may be specified right down to the class level. This can be useful for libraries with only one class in the global namespace. If the php source file is also located in the root of the package, for example, it may be declared like this: { "autoload": { "psr-0": { "UniqueGlobalClass": "" } }
} If you want to have a fallback directory where any namespace can be, you can use an empty prefix like: { "autoload": { "psr-0": { "": "src/" } }
} Classmap The classmap references are all combined, during install/update, into a single key => value array which may be found in the generated file vendor/composer/autoload_classmap.php. This map is built by scanning for classes in all .php and .inc files in the given directories/files. You can use the classmap generation support to define autoloading for all libraries that do not follow PSR-0/4. To configure this you specify all directories or files to search for classes. Example: { "autoload": { "classmap": ["src/", "lib/", "Something.php"] }
} Wildcards (*) are also supported in a classmap paths, and expand to match any directory name: Example: { "autoload": { "classmap": ["src/addons/*/lib/", "3rd-party/*", "Something.php"] }
} Files If you want to require certain files explicitly on every request then you can use the files autoloading mechanism. This is useful if your package includes PHP functions that cannot be autoloaded by PHP. Example: { "autoload": { "files": ["src/MyLibrary/functions.php"] }
} Exclude files from classmaps If you want to exclude some files or folders from the classmap you can use the exclude-from-classmap property. This might be useful to exclude test classes in your live environment, for example, as those will be skipped from the classmap even when building an optimized autoloader. The classmap generator will ignore all files in the paths configured here. The paths are absolute from the package root directory (i.e. composer.json location), and support * to match anything but a slash, and ** to match anything. ** is implicitly added to the end of the paths. Example: { "autoload": { "exclude-from-classmap": ["/Tests/", "/test/", "/tests/"] }
} Optimizing the autoloader The autoloader can have quite a substantial impact on your request time (50-100ms per request in large frameworks using a lot of classes). See the article about optimizing the autoloader for more details on how to reduce this impact.

