The main repository type is the composer repository. It uses a single packages.json file that contains all of the package metadata. This is also the repository type that packagist uses. To reference a composer repository, supply the path before the packages.json file. In the case of packagist, that file is located at /packages.json, so the URL of the repository would be repo.packagist.org. For example.org/packages.json the repository URL would be example.org. { "repositories": [ { "type": "composer", "url": "https://example.org" } ]
} packages The only required field is packages. The JSON structure is as follows: { "packages": { "vendor/package-name": { "dev-master": { @composer.json }, "1.0.x-dev": { @composer.json }, "0.0.1": { @composer.json }, "1.0.0": { @composer.json } } }
} The @composer.json marker would be the contents of the composer.json from that package version including as a minimum: name version dist or source Here is a minimal package definition: { "name": "smarty/smarty", "version": "3.1.7", "dist": { "url": "https://www.smarty.net/files/Smarty-3.1.7.zip", "type": "zip" }
} It may include any of the other fields specified in the schema . notify-batch The notify-batch field allows you to specify a URL that will be called every time a user installs a package. The URL can be either an absolute path (that will use the same domain as the repository), or a fully qualified URL. An example value: { "notify-batch": "/downloads/"
} For example.org/packages.json containing a monolog/monolog package, this would send a POST request to example.org/downloads/ with following JSON request body: { "downloads": [ {"name": "monolog/monolog", "version": "1.2.1.0"} ]
} The version field will contain the normalized representation of the version number. This field is optional.

