The list field allows you to return the names of packages which match a given field (or all names if no filter is present). It should accept an optional ?filter=xx query param, which can contain * as wildcards matching any substring. Replace/provide rules should not be considered here. It must return an array of package names: { "packageNames": [ "a/b", "c/d" ]
} See https://packagist.org/packages/list.json?filter=composer/* for example. This field is optional. provider-includes and providers-url The provider-includes field allows you to list a set of files that list package names provided by this repository. The hash should be a sha256 of the files in this case. The providers-url describes how provider files are found on the server. It is an absolute path from the repository root. It must contain the placeholders %package% and %hash%. These fields are used by Composer v1, or if your repository does not have the metadata-url field set. An example: { "provider-includes": { "providers-a.json": { "sha256": "f5b4bc0b354108ef08614e569c1ed01a2782e67641744864a74e788982886f4c" }, "providers-b.json": { "sha256": "b38372163fac0573053536f5b8ef11b86f804ea8b016d239e706191203f6efac" } }, "providers-url": "/p/%package%$%hash%.json"
} Those files contain lists of package names and hashes to verify the file integrity, for example: { "providers": { "acme/foo": { "sha256": "38968de1305c2e17f4de33aea164515bc787c42c7e2d6e25948539a14268bb82" }, "acme/bar": { "sha256": "4dd24c930bd6e1103251306d6336ac813b563a220d9ca14f4743c032fb047233" } }
} The file above declares that acme/foo and acme/bar can be found in this repository, by loading the file referenced by providers-url, replacing %package% by the vendor namespaced package name and %hash% by the sha256 field. Those files themselves contain package definitions as described above . These fields are optional. You probably don't need them for your own custom repository. cURL or stream options The repository is accessed either using cURL (Composer 2 with ext-curl enabled) or PHP streams. You can set extra options using the options parameter. For PHP streams, you can set any valid PHP stream context option. See Context options and parameters for more information. When cURL is used, only a limited set of http and ssl options can be configured. { "repositories": [ { "type": "composer", "url": "https://example.org", "options": { "http": { "timeout": 60 } } } ], "require": { "acme/package": "^1.0" }
}

