VCS stands for version control system. This includes versioning systems like git, svn, fossil or hg. Composer has a repository type for installing packages from these systems. Loading a package from a VCS repository There are a few use cases for this. The most common one is maintaining your own fork of a third party library. If you are using a certain library for your project, and you decide to change something in the library, you will want your project to use the patched version. If the library is on GitHub (this is the case most of the time), you can fork it there and push your changes to your fork. After that you update the project's composer.json. All you have to do is add your fork as a repository and update the version constraint to point to your custom branch. In composer.json only, you should prefix your custom branch name with "dev-" (without making it part of the actual branch name). For version constraint naming conventions see Libraries for more information. Example assuming you patched monolog to fix a bug in the bugfix branch: { "repositories": [ { "type": "vcs", "url": "https://github.com/igorw/monolog" } ], "require": { "monolog/monolog": "dev-bugfix" }
} When you run php composer.phar update, you should get your modified version of monolog/monolog instead of the one from packagist. Note that you should not rename the package unless you really intend to fork it in the long term, and completely move away from the original package. Composer will correctly pick your package over the original one since the custom repository has priority over packagist. If you want to rename the package, you should do so in the default (often master) branch and not in a feature branch, since the package name is taken from the default branch. Also note that the override will not work if you change the name property in your forked repository's composer.json file as this needs to match the original for the override to work. If other dependencies rely on the package you forked, it is possible to inline-alias it so that it matches a constraint that it otherwise would not. For more information see the aliases article . Using private repositories Exactly the same solution allows you to work with your private repositories at GitHub and Bitbucket: { "require": { "vendor/my-private-repo": "dev-master" }, "repositories": [ { "type": "vcs", "url": "git@bitbucket.org:vendor/my-private-repo.git" } ]
} The only requirement is the installation of SSH keys for a git client. Git alternatives Git is not the only version control system supported by the VCS repository. The following are supported: Git: git-scm.com Subversion: subversion.apache.org Mercurial: mercurial-scm.org Fossil : fossil-scm.org To get packages from these systems you need to have their respective clients installed. That can be inconvenient. And for this reason there is special support for GitHub and Bitbucket that use the APIs provided by these sites, to fetch the packages without having to install the version control system. The VCS repository provides dists for them that fetch the packages as zips. GitHub: github.com (Git) Bitbucket: bitbucket.org (Git) The VCS driver to be used is detected automatically based on the URL. However, should you need to specify one for whatever reason, you can use bitbucket, github, gitlab, perforce, fossil, git, svn or hg as the repository type instead of vcs. If you set the no-api key to true on a github repository it will clone the repository as it would with any other git repository instead of using the GitHub API. But unlike using the git driver directly, Composer will still attempt to use github's zip files. Please note: To let Composer choose which driver to use the repository type needs to be defined as "vcs" If you already used a private repository , this means Composer should have cloned it in cache. If you want to install the same package with drivers, remember to launch the command composer clearcache followed by the command composer update to update Composer cache and install the package from dist. VCS driver git-bitbucket is deprecated in favor of bitbucket Bitbucket Driver Configuration Note that the repository endpoint for Bitbucket needs to be https rather than git. After setting up your bitbucket repository, you will also need to set up authentication . Subversion Options Since Subversion has no native concept of branches and tags, Composer assumes by default that code is located in $url/trunk, $url/branches and $url/tags. If your repository has a different layout you can change those values. For example if you used capitalized names you could configure the repository like this: { "repositories": [ { "type": "vcs", "url": "http://svn.example.org/projectA/", "trunk-path": "Trunk", "branches-path": "Branches", "tags-path": "Tags" } ]
} If you have no branches or tags directory you can disable them entirely by setting the branches-path or tags-path to false. If the package is in a subdirectory, e.g. /trunk/foo/bar/composer.json and /tags/1.0/foo/bar/composer.json, then you can make Composer access it by setting the "package-path" option to the sub-directory, in this example it would be "package-path": "foo/bar/". If you have a private Subversion repository you can save credentials in the http-basic section of your config (See Schema ): { "http-basic": { "svn.example.org": { "username": "username", "password": "password" } }
} If your Subversion client is configured to store credentials by default these credentials will be saved for the current user and existing saved credentials for this server will be overwritten. To change this behavior by setting the "svn-cache-credentials" option in your repository configuration: { "repositories": [ { "type": "vcs", "url": "http://svn.example.org/projectA/", "svn-cache-credentials": false } ]
}

