There are some cases, when there is no ability to have one of the previously mentioned repository types online, even the VCS one. A typical example could be cross-organisation library exchange through build artifacts. Of course, most of the time these are private. To use these archives as-is, one can use a repository of type artifact with a folder containing ZIP or TAR archives of those private packages: { "repositories": [ { "type": "artifact", "url": "path/to/directory/with/zips/" } ], "require": { "private-vendor-one/core": "15.6.2", "private-vendor-two/connectivity": "*", "acme-corp/parser": "10.3.5" }
} Each zip artifact is a ZIP archive with composer.json in root folder: unzip -l acme-corp-parser-10.3.5.zip composer.json
... If there are two archives with different versions of a package, they are both imported. When an archive with a newer version is added in the artifact folder and you run update, that version will be imported as well and Composer will update to the latest version.

