In addition to the artifact repository, you can use the path one, which allows you to depend on a local directory, either absolute or relative. This can be especially useful when dealing with monolithic repositories. For instance, if you have the following directory structure in your repository: ...
├── apps
│ └── my-app
│ └── composer.json
├── packages
│ └── my-package
│ └── composer.json
... Then, to add the package my/package as a dependency, in your apps/my-app/composer.json file, you can use the following configuration: { "repositories": [ { "type": "path", "url": "../../packages/my-package" } ], "require": { "my/package": "*" }
} If the package is a local VCS repository, the version may be inferred by the branch or tag that is currently checked out. Otherwise, the version should be explicitly defined in the package's composer.json file. If the version cannot be resolved by these means, it is assumed to be dev-master. When the version cannot be inferred from the local VCS repository, or when you want to override the version, you can use the versions option when declaring the repository: { "repositories": [ { "type": "path", "url": "../../packages/my-package", "options": { "versions": { "my/package": "4.2-dev" } } } ]
} The local package will be symlinked if possible, in which case the output in the console will read Symlinking from ../../packages/my-package. If symlinking is not possible the package will be copied. In that case, the console will output Mirrored from ../../packages/my-package. Instead of default fallback strategy you can force to use symlink with "symlink": true or mirroring with "symlink": false option. Forcing mirroring can be useful when deploying or generating package from a monolithic repository. Note: On Windows, directory symlinks are implemented using NTFS junctions because they can be created by non-admin users. Mirroring will always be used on versions below Windows 7 or if proc_open has been disabled. { "repositories": [ { "type": "path", "url": "../../packages/my-package", "options": { "symlink": false } } ]
} Leading tildes are expanded to the current user's home folder, and environment variables are parsed in both Windows and Linux/Mac notations. For example ~/git/mypackage will automatically load the mypackage clone from /home/<username>/git/mypackage, equivalent to $HOME/git/mypackage or %USERPROFILE%/git/mypackage. Note: Repository paths can also contain wildcards like * and ?. For details, see the PHP glob function . You can configure the way the package's dist reference (which appears in the composer.lock file) is built. The following modes exist: none - reference will be always null. This can help reduce lock file conflicts in the lock file but reduces clarity as to when the last update happened and whether the package is in the latest state. config - reference is built based on a hash of the package's composer.json and repo config auto (used by default) - reference is built basing on the hash like with config, but if the package folder contains a git repository, the HEAD commit's hash is used as reference instead. { "repositories": [ { "type": "path", "url": "../../packages/my-package", "options": { "reference": "config" } } ]
}

